import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import MyBarChaBarChart from './MyBarChart'; // Import your chart components
import authenticatedFetch from './authenticatedFetch';

function SurveyVisualizations() {
  const [aggregatedData, setAggregatedData] = useState([]);
  const { surveyId } = useParams();

  useEffect(() => {
    authenticatedFetch(`https://vigilant-orbit-v6x6pp4w99636w9v-3000.app.github.dev/survey-responses/:surveyId/visualize`)
      .then(response => response.json())
      .then(data => setAggregatedData(data))
      .catch(error => console.error('Error fetching aggregated data:', error));
  }, [surveyId]);

  // Function to select and render the appropriate visualization component
  const renderVisualization = (data, questionType) => {
    switch (questionType) {
      case 'multiple_choice':
        return <BarChart data={data} />;
      case 'rating_scale':
        return <BarChart data={data} />; // Assuming you have a LineChart component
      // Add other cases as needed
      default:
        return <p>No visualization available for this question type</p>;
    }
  };

  return (
    <div className="p-4 shadow-lg">
      <h2 className="text-2xl font-bold mb-4">Survey Visualizations</h2>
      {aggregatedData.map((data, index) => (
        // Call renderVisualization with the data and its corresponding question type
        renderVisualization(data, data.questionType) // Assuming data includes questionType
      ))}
    </div>
  );
}

export default SurveyVisualizations;
